import Layout from '../components/layout';

const HomePage = (props) => (

<Layout>
    <section id="hero" className="parallax">
        
        <h2>Welcome to My Project</h2>
        <p>We created this project with Next.js......</p>
    </section>
</Layout>
);




export default HomePage;
